css:
@-moz-document domain("youtube.com") {
/*
 * Name: Mayhem in Monsterland progress bar for YouTube
 * Title: Mayhem in Monsterland (C64) animated Youtube progress bar
 * Author:  MighstAllCruckingFighty
 * Date: 8 Feb 2020
 * Version: 0.2
*/
.html5-play-progress, .ytp-play-progress { background: url("data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAAMCAIAAAAs6UAAAAAAOUlEQVQImWPodDBjYpd/z6Qt4cEkmsrCxMDAwPD//3+mta87mc5dtWd696qKSeT4TCYGBgYmvmtXAFLUD7AfCbaXAAAAAElFTkSuQmCC") repeat-x !important; }
.html5-load-progress, .ytp-load-progress { background: url("data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAAMCAIAAAAs6UAAAAAAKklEQVQImTXFMRHAQAwDMJ3pGE9Yhk7wfKdqEZiZtA3S1nsvu5u7C/7hAw2/DBEZxr5vAAAAAElFTkSuQmCC") !important; }
.html5-scrubber-button, .ytp-scrubber-button { background: url("data:image/gif;base64,") !important; width: 24px !important; height: 21px !important; border: none !important; margin-left: -5px !important; margin-top: -3px !important; transform: scale(1); }
.ytp-progress-bar-container:hover .ytp-scrubber-button, .ytp-progress-bar-container:hover .ytp-load-progress { image-rendering: auto; }
.html5-progress-bar-container, .ytp-progress-bar-container { height: 12px !important; }
.html5-progress-bar, .ytp-progress-bar { margin-top: 12px !important; }
.html5-progress-list, .ytp-progress-list, .video-ads .html5-progress-list.html5-ad-progress-list, .video-ads .ytp-progress-list.ytp-ad-progress-list { height: 12px !important; }
.ytp-volume-slider-handle { background: url("data:image/gif;base64,") !important; width: 16px !important; height: 16px !important; border: none !important; }
}
